import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { Routes, Route } from "react-router-dom";
import Header from "./Components/Header";

function App() {
	return (
		<div className="main">
			<Routes>
				<Route path="/header" element={<Header></Header>}></Route>
			</Routes>
		</div>
	);
}

export default App;
